import Attributes from "./Attributes";

const Tag = ({ tag }: { tag: any }) => {
    return (
        <div className="flex flex-col">
            <span className="flex">
                {`<`}
                {tag.name}
                <Attributes attrs={tag.attrs} />
                {`>`}
            </span>
            {tag.children && tag.children.map((child: any) => (
                child.type === 'text' ? 
                <p>{child.content}</p>
                :
                <p>tag</p>
                
            ))}
            <span>{`</`}{tag.name}{`>`}</span>
        </div>
    )
}

export default Tag;
